import React from 'react'

function Images() {
  return (
    <div className='w-full h-[70vh] bg-white flex items-center justify-center' >
      <div className='w-[40%] h-1/2 bg-red-600 '>
        <img src="https://a.storyblok.com/f/133769/748x1278/5784aa7150/home-news-1.jpg/m/700x1196/filters:quality(90)" alt="" />
      </div>
      <div className='w-'></div>
    </div>
  )
}

export default Images
